description:
UM PROGRAMA HISTÓRICO na edição 100 do Alê Oliveira Responde. Com direito a surpresa pro Alê Oliveira, Fred de entrevistador, participações absurdas como Kaká, Felipe Melo, Thiago Ventura + uma galera sensacional e choro no fim! ESSE PROGRAMA MERECE RECORDE DE LIKE E INSCRITOS! AJUDA NÓS AÍ E MANDA PROS AMIGOS!


PROGRAMAÇÃO CANAL DE SOLA:

- Esquetes com Cazé e Certezas quartas e sábados 11h;
- Alê Oliveira Responde, toda quinta às 19h;
